I can’t take these two anywhere 😂 We had so much fun in Hollywood yesterday ⭐️ We’ve been showing Jamari (Mya’s bestie) all around Southern California and I had no idea how much I would enjoy playing “tourist” 🤩 For those who have been asking, the wax figures you saw in our stories are at Madame Tussaud’s in Hollywood (on the Walk of Fame). I took Emaya here back in 2016 when she first came to live with me so it was a MUST on our list to re-visit! I’ll be posting the vlog on our YouTube channel soon!

